import React from 'react';
import "./SimpleInput.css"

const SimpleInput = ({val, setVal}) => {
    return (
        <input className={"simple-input"} value={val} onChange={(e) => {setVal(e.target.value)}}/>
    );
};

export default SimpleInput;
